function formValidation(param) {
    var body = document.getElementsByTagName('body')[0];
    var head = document.getElementsByTagName('head');
    var currenthref = (window.location.href.split('?')[0]).split('//')[1];
    var scriptsPath = '//scripts.autotovarka.ru/';
    var params = '';
    if (window.location.href.split('?')[1] != undefined) params = window.location.href.split('?')[1];

    var forms = document.getElementsByTagName('form');
    for (var i = 0; i < forms.length; i++) {
        var form = forms[i];
        var inputs = form.getElementsByTagName('*');
        for (var ii = 0; ii < inputs.length; ii++) {
            inputs[ii].required = true;
            if (inputs[ii].getAttribute('name') == 'phone') {
                inputs[ii].setAttribute('placeholder', '+7(___)___-__-__');
                // inputs[ii].setAttribute('minlength', '16');
                inputs[ii].onclick = function () {
                    if (this.value.length == 0) {
                        this.value = '+7(';
                    }
                };
                inputs[ii].onkeypress = function (e) {

                    e = e || event;

                    if (e.ctrlKey || e.altKey || e.metaKey) return;

                    var chr = getChar(e);
                    if (chr == null) return;

                    if (chr < '0' || chr > '9') {
                        return false;
                    } else {
                        var v = this.value;
                        if (v.match(/^\d{0}$/) !== null) {
                            this.value = '+7(' + v;
                        } else if (v.match(/^\+7\(\d{3}$/) !== null) {
                            this.value = v + ')';
                        } else if (v.match(/^\+7\(\d{3}\)\d{3}$/) !== null) {
                            this.value = v + '-';
                        } else if (v.match(/^\+7\(\d{3}\)\d{3}\-\d{2}$/) !== null) {
                            this.value = v + '-';
                        }
                        if (v.length >= 16) {
                            return false;
                        }
                    }
                };

                function getChar(event) {
                    if (event.which == null) {
                        if (event.keyCode < 32) return null;
                        return String.fromCharCode(event.keyCode) // IE
                    }

                    if (event.which != 0 && event.charCode != 0) {
                        if (event.which < 32) return null;
                        return String.fromCharCode(event.which) // other
                    }

                    return null;
                }
            }
        }
        form.removeAttribute('action');
        form.removeAttribute('method');
        form.removeAttribute('onsubmit');
        form.addEventListener("submit", (function (e) {
            e.preventDefault();
            var c_form = e.currentTarget;
            if (!c_form.checkValidity()) {
                var inputs = c_form.getElementsByTagName('input');
                for (var i = 0; i < inputs.length; i++) {
                    var input = inputs[i];
                    var type = input.attributes['type'];
                    if (type.value == 'text' || type.value == "tel") {
                        if (input.validity.valid) {
                            input.style.background = "#FFFFFF";
                        } else {
                            input.style.background = "#BE4C54";
                        }
                    }
                }
                return;
            }
            console.log(c_form.checkValidity());
            if (c_form.phone.value.length < 16) {
                alert("Пожалуйста, укажите корректный номер телефона!")
            } else {

                var form = 'name=' + encodeURIComponent(c_form.name.value) +
                    '&phone=' + encodeURIComponent(c_form.phone.value) +
                    '&url=' + encodeURIComponent(currenthref) +
                    '&params=' + encodeURIComponent(params);
                var xhr = new XMLHttpRequest();
                xhr.open("POST", scriptsPath + "order.php", true);
                xhr.setRequestHeader('Content-Type', 'application/x-www-form-urlencoded');
                xhr.onload = function () {
                    if(encodeURIComponent(c_form.name.value)!="test") {
                        window.location.href = 'http://checkout2.autotoolza.ru/?done&' + params;
                    }
                }
                xhr.send(form);

                // setTimeout(function () {
                //     window.location.href = 'http://checkout2.autotoolza.ru/?done&' + params
                // }, 1500);
            }
        }));
    }
};
